<script>
    @if(old('action') == 'register' and !$errors->isEmpty())
    $('#password-new').css('display', 'inline');
    $('#form-login').attr('action', '{{ route('user.update.password') }}');
    $('#login').text('Daftar');
    @endif

    $(document).ready(function () {
        $.ajaxSetup({
            headers: {
                'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
            }
        });

        $('#nim').on('input', function () {
            let nim = $('#nim').val();
            if (nim.length > 9) {
                $.ajax({
                    url: "{{ route('user.check.nim') }}",
                    type: "POST",
                    data: {nim: nim,},
                    success: function (result) {
                        if (result['status']) {
                            if (result['isNewPassword']) {
                                $('#identifier').text('Hai ' + result['name'][0] + ', Masukan password baru kamu!');
                                $('#form-login').attr('action', '{{ route('user.update.password') }}');
                                $('#login').text('Daftar');
                                $('#action').val('register');
                                $('#password-new').css('display', 'inline');
                            } else {
                                $('#identifier').text('Hai ' + result['name'][0] + ', Selamat datang!');
                            }
                        } else {
                            $('#identifier').text('NIM kamu tidak terdaftar. Silakan hubungi asisten');
                        }

                    }
                })
            }

        });
    });

</script>

